import * as React from "react";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import ButtonGroup from "@mui/material/ButtonGroup";
import AboutMe from "../AboutMe";

// const renderAboutMe = () => {
//   renderAboutMe = true
//   let button = document.getElementById("btn1").onclick
//   if (button && renderAboutMe === true)
//     renderAboutMe = false
// }

export default function Menu() {
  return (
    <Box
      sx={{
        display: "flex",
        alignItems: "top",
        textAlign: "center",
        bgcolor: "black",
        borderRadius: 5,
        color: "white",
        justifyContent: "space-between",
        padding: "15px 15px 15px 15px",
      }}
    >
      <Box>
        <ButtonGroup sx={{ color: "#fff" }} variant="outlined" aria-label="outlined button group">
          <Button id="btn1" >About Me</Button>
          <Button >Projects</Button>
          <Button >Contact</Button>
        </ButtonGroup>
      </Box>
      <AboutMe view={true}></AboutMe>
    </Box>

  );
}
